import { AST } from "eslint";
import React from "react";
import * as S from "./styled";
import { FiPlus } from "react-icons/fi";
import profile from "../../assets/profile.jpg";

export type CardProps = {
  profile_image?: string;
  nickName: string;
  text_post: string;
  title: string;
};

const CardPost: React.FC<CardProps> = ({
  nickName,
  profile_image,
  text_post,
  title,
}) => {
  return (
    <S.Wrapper>
      <S.ProfileImage>
        <img src={profile} alt="" />
      </S.ProfileImage>
      <S.ContainerText>
        <S.ProfileName>
          <h3>{nickName} </h3>
        </S.ProfileName>
        <S.PostText>
          <p>{text_post} </p>
        </S.PostText>

        <S.IconWrapper>
          <button>
            {" "}
            <FiPlus />{" "}
          </button>
        </S.IconWrapper>
      </S.ContainerText>
    </S.Wrapper>
  );
};

export default CardPost;
